function Block(props){

    let blockStyle ={
        backgroundColor: props.baColor,
        borderColor: "black",
        height: "100px",
        width: "100px",
        borderWidth: "2px",
        borderStyle:"solid"
    }

    return(
        <div style = {blockStyle}> </div>
    )

}


export default Block;
